import React from 'react';

const Task = ({ task, onDelete, onEdit }) => {
  return (
    <tr>
      <td>{task.assignedTo}</td>
      <td>{task.status}</td>
      <td>{task.dueDate}</td>
      <td>{task.priority}</td>
      <td>{task.comments}</td>
      <td>
        <button className="btn btn-warning" onClick={() => onEdit(task)}>Edit</button>
        <button className="btn btn-danger ms-2" onClick={() => onDelete(task.id)}>Delete</button>
      </td>
    </tr>
  );
};

export default Task;
